import React from 'react';
import Container from 'react-bootstrap/esm/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';

const Developer = () => {

    return (
        <div className='main-content'>
            <Card style={{ width: '54rem', height: '75rem', margin: '10px', backgroundColor: 'black', border: '1px solid white' }}>
                <div className="d-flex justify-content-center align-items-center">
                  <Card.Img variant="top" src="ProfilePhoto.JPG" alt="Yifei Zhou" style={{ width: '51rem', height: '54rem', marginBottom: '10px' }} />
                </div>
                <Card.Body>
                  <Card.Title style={{ fontSize: '1.2rem', marginBottom: '10px', color: 'white' }}>Developer: Yifei Zhou</Card.Title>
                  <Card.Text>
                    MS Computer Science Student at Brandeis University
                  </Card.Text>
                </Card.Body>
              </Card>
        </div>
    );
}

export default Developer;
